query QueryRenderersFairQuery(
  $fairID: String!
) {
  fair(id: $fairID) {
    ...Fair_fair
    __id
  }
}

fragment Fair_fair on Fair {
  ...FairHeader_fair
  __id
}

fragment FairHeader_fair on Fair {
  id
  name
  image {
    image_url
    aspect_ratio
    url
  }
  organizer {
    profile {
      icon {
        id
        href
        height
        width
        url
      }
      name
      __id
    }
  }
  location {
    address
    address_2
    coordinates {
      lat
      lng
    }
    display
    city
    state
    country
    postal_code
    __id
  }
  start_at
  end_at
  __id
}
